import { createApp } from 'vue'
import { createRenderer } from 'vue-server-renderer'
import { connect } from '@module-federation/client'
import App from './App.vue'

connect({
  remote: {
    vue1: 'vue1@http://localhost:8083/remoteEntry.js',
  },
}).then((remote) => {
    const { createApp: remoteCreateApp } = remote
    const { renderer } = createRenderer()

    const app = remoteCreateApp()
    app.mount('#app', true)
})
